INSERT INTO `cpath` VALUES (102, 'P-TGFBR2-TGFBR2', 'P-TGFBR2-TGFBR2', 'INTERACTION', 'catalysis', -9999, 'BIO_PAX', '<catalysis xmlns="http://www.biopax.org/release/biopax-level2.owl#" xmlns:rdf="http://www.w3.org/1999/02/22-rdf-syntax-ns#" rdf:ID="CPATH-102">\r\n  <EVIDENCE>\r\n    <evidence rdf:ID="CPATH-LOCAL-976">\r\n      <EVIDENCE-CODE>\r\n        <openControlledVocabulary rdf:ID="CPATH-LOCAL-977">\r\n          <XREF>\r\n            <unificationXref rdf:ID="CPATH-LOCAL-978">\r\n              <ID>MI:0493</ID>\r\n              <DB>PSIMI</DB>\r\n            </unificationXref>\r\n          </XREF>\r\n          <TERM>in vivo</TERM>\r\n        </openControlledVocabulary>\r\n      </EVIDENCE-CODE>\r\n      <XREF>\r\n        <publicationXref rdf:ID="CPATH-LOCAL-979">\r\n          <ID>9155023</ID>\r\n          <DB>Pubmed</DB>\r\n        </publicationXref>\r\n      </XREF>\r\n      <EVIDENCE-CODE>\r\n        <openControlledVocabulary rdf:ID="CPATH-LOCAL-980">\r\n          <TERM>in vitro</TERM>\r\n          <XREF>\r\n            <unificationXref rdf:ID="CPATH-LOCAL-981">\r\n              <ID>MI:0492</ID>\r\n              <DB>PSIMI</DB>\r\n            </unificationXref>\r\n          </XREF>\r\n        </openControlledVocabulary>\r\n      </EVIDENCE-CODE>\r\n    </evidence>\r\n  </EVIDENCE>\r\n  <CONTROLLER>\r\n    <proteinParticipant rdf:ID="CPATH-LOCAL-982">\r\n      <PHYSICAL-ENTITY rdf:resource="#CPATH-123" />\r\n      <CELLULAR-LOCATION>\r\n        <openControlledVocabulary rdf:ID="CPATH-LOCAL-983">\r\n          <TERM>plasma membrane</TERM>\r\n          <XREF>\r\n            <unificationXref rdf:ID="CPATH-LOCAL-984">\r\n              <ID>0005886</ID>\r\n              <DB>GO</DB>\r\n            </unificationXref>\r\n          </XREF>\r\n        </openControlledVocabulary>\r\n      </CELLULAR-LOCATION>\r\n    </proteinParticipant>\r\n  </CONTROLLER>\r\n  <EVIDENCE>\r\n    <evidence rdf:ID="CPATH-LOCAL-985">\r\n      <XREF>\r\n        <publicationXref rdf:ID="CPATH-LOCAL-986">\r\n          <ID>9169454</ID>\r\n          <DB>Pubmed</DB>\r\n        </publicationXref>\r\n      </XREF>\r\n    </evidence>\r\n  </EVIDENCE>\r\n  <NAME>P-TGFBR2-TGFBR2</NAME>\r\n  <DIRECTION>PHYSIOL-LEFT-TO-RIGHT</DIRECTION>\r\n  <XREF rdf:resource="#CPATH-LOCAL-979" />\r\n  <COMMENT>Autophosphorylation of TGFBR2.Three autophosophorylated sites (S213, S409, S416) have been found.S213 is a major autophosphorylation site for TGFBR2 which requires for kinase activity (regulatory autophosphorylation site) as well as TGFBR2 dimerization independent.  Additional autophosphorylation sites  of TGFBR2  include S409 (positively regulated) and S416 (negatively regulated) which are TGFBR2 dimerization dependent. Apart from serine and threonine autophosphorylation of TGFBR2, it   autophosphorylates at Y259, Y336, and Y424 also.</COMMENT>\r\n  <XREF rdf:resource="#CPATH-LOCAL-986" />\r\n  <CONTROLLED rdf:resource="#CPATH-74" />\r\n  <EVIDENCE>\r\n    <evidence rdf:ID="CPATH-LOCAL-987">\r\n      <XREF>\r\n        <publicationXref rdf:ID="CPATH-LOCAL-988">\r\n          <DB>Pubmed</DB>\r\n          <ID>7878020</ID>\r\n        </publicationXref>\r\n      </XREF>\r\n    </evidence>\r\n  </EVIDENCE>\r\n  <XREF rdf:resource="#CPATH-LOCAL-988" />\r\n  <XREF>\r\n    <unificationXref ID="CPATH-LOCAL-1833">\r\n      <DB rdf:datatype="http://www.w3.org/2001/XMLSchema#string">CPATH</DB>\r\n      <ID rdf:datatype="http://www.w3.org/2001/XMLSchema#string">102</ID>\r\n    </unificationXref>\r\n  </XREF>\r\n</catalysis>', '2006-02-10 00:00:00', '2006-02-10 00:00:00');
